Note: These instructions were only tested with the GrapheneOS flavor. This method does not work for the LineageOS flavor because it uses its own updater. Essentially this boils down to just serving the otaDir build output on the web, e.g. with nginx. To receive OTA updates on the device, enable the updater and point it to the domain and possibly subdirectory that you will be serving OTA updates from: # device configuration
{ apps = { updater.enable = true; updater.url = "https://example.com/android/"; };
} On the server, it is as easy as serving a directory at the required endpoint: # NixOS server configuration
{ services.nginx.enable = true; systemd.services.nginx.serviceConfig.ReadOnlyPaths = [ "/var/www" ]; services.nginx.virtualHosts."example.com" = { forceSSL = true; enableACME = true; locations."/android/" = { root = "/var/www"; tryFiles = "$uri $uri/ =404"; }; };
} The directory simply contains symlinks to the store paths that were contained in the otaDir output that was built earlier. I choose to just copy the result symlink to /var/www/android. $ cp --no-dereference ota-dir /var/www/android
$ tree -l /var/www
/var/www
└── android -> /nix/store/dbjcl9lwn6xif9c0fy8d2wwpn9zi4hw4-sunfish-otaDir ├── sunfish-ota_update-2021.02.06.16.zip -> /nix/store/wwr49all6x868f0mdl11369ybfwyir0f-sunfish-ota_update-2021.02.06.16.zip ├── sunfish-stable -> /nix/store/c1rp46m9spncanacglqs5mxk6znfs44s-sunfish-stable └── sunfish-target_files-2021.02.06.16.zip -> /nix/store/8ys21rzjqhi2055d7bd4iwa15fv1m446-sunfish-signed_target_files-2021.02.06.16.zip Of course, this doesn't have to be located at /var/www and it's totally possible to integrate updating of the OTA directory into your other robotnix build automation. In this case it is as easy as updating the /var/www/android symlink with the new build output. Here it was assumed that robotnix was built on the same machine that you will serve the OTA from. If that is not the case you can conveniently copy the closure to a remote host using nix copy as in $ nix copy --to ssh://user@example.com ./ota-dir Don't forget to add the store path of the ota-dir as a garbage collector root on the remote machine or it might be collected in the next sweep.

5.body:
F-Droid can manage multiple repositories to fetch apps from. These can be set up manually in the app, but with robotnix it is also possible to preload F-Droid with some repositories at build time. To add an F-Droid repository you need at least the URL and a public key. Obtaining the URL is in general very easy but it's not obvious where to obtain the public key. We'll take the microG repository as an example. The repository is located here . To obtain the repository index download the index.xml file from the repository root: $ curl -LO https://microg.org/fdroid/repo/index.xml The content of this XML file contains metadata about the repository, including the public key: <?xml version="1.0" encoding="utf-8"?>
<fdroid> <repo name="microG F-Droid repo" icon="fdroid-icon.png" url="https://microg.org/fdroid/repo" version="19" timestamp="1606314565" pubkey=""> <description>This is a repository of microG apps to be used with F-Droid. Applications in this repository are signed official binaries built by the microG Team from the corresponding source code. </description> </repo> <application id="..."> <!-- ... list of contained applications ... --> </application>
</fdroid> Simply copy the name and pubkey fields and use them as the name and public key for the corresponding Nix expression respectively. { apps.fdroid.additionalRepos = { "microG F-Droid repo" = { enable = true; url = "https://microg.org/fdroid/repo"; pubkey = ""; }; };
} The name can really be anything, but the one that is provided here is the one that shows up before refreshing the F-Droid repo list for the first time, so if you want that to look pretty, give it a pretty name here.

8.body:
Before we begin we have to obtain the fingerprint of the custom Auditor app and the AVB fingerprint. To get the Auditor app fingerprint, we simply use OpenSSL to extract the fingerprint of the signing certificate: $ openssl x509 -noout -fingerprint -sha256 -in keys/auditor.x509.pem | awk -F '=' '{gsub(/:/,""); print $2}'
AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA The AVB fingerprint is a bit more tricky. I own a Pixel 4a (sunfish) and on this device the AVB fingerprint is simply the SHA256 hash of the AVB key, but this is not the case on other devices. Check the Auditor source code for details. $ sha256sum keys/sunfish/avb_pkmd.bin | awk '{print toupper($1)}'
BBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBB Now you can import robotnix in your NixOS configuration with the aforementioned fingerprints. { config, lib, pkgs, ... }:
{ imports = [ ((builtins.fetchTarball { name = "robotnix"; # Replace the git revision and sha256 with ones referring to a recent commit url = "https://github.com/danielfullmer/robotnix/archive/61b91d145f0b08cf0d4d73fb1d7ba74b9899b788.zip"; sha256 = "1dihmdw5w891jq2fm7mcx30ydjjd33ggbb60898841x5pzjx6ynv"; }) + "/nixos") ]; services.attestation-server = { enable = true; domain = "attestation.example.com"; device = "sunfish"; signatureFingerprint = "AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA"; avbFingerprint = "BBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBB"; #disableAccountCreation = true; # optionally uncomment after creating your account #nginx.enableACME = true; # optionally uncomment if you want to use Let's Encrypt for HTTPS };
} Register and optionally disable account creation. The start the “Robotnix Auditor” app on your phone and open the menu (three dots). Choose “Enable remote verification” and scan the QR code on your attestation server. The attestation server keeps its state in /var/lib/private/attestation. Make periodic backups!
